import Footer from "./components/Footer";
import Header from "./components/Header/Header";
import HeaderTop from "./components/Header/HeaderTop";
import Home from "./components/pages/Home";

function App() {
  return (
    <div className="App">
      <HeaderTop />
      <Header />
      <Home />
      <Footer />
    </div>
  );
}

export default App;
